// ==UserScript==
// @name         web 助手
// @namespace    http://tampermonkey.net/
// @version      0.1
// @description  web 开发工具集, 目前实现了cookie和localStorage快照功能, 方便快速切换账号
// @author       peterq <me@peterq.cn>
// @match        *://*/*
// @grant        unsafeWindow
// @grant        GM_deleteValue
// @grant        GM_listValues
// @grant        GM_addValueChangeListener
// @grant        GM_removeValueChangeListener
// @grant        GM_setValue
// @grant        GM_getValue
// @grant        GM_registerMenuCommand
// @grant        GM_unregisterMenuCommand
// @grant        GM_getResourceText
// @grant        GM_getResourceURL
// @grant        GM_addStyle
// @resource ele_css https://unpkg.com/element-ui/lib/theme-chalk/index.css
// @resource ele_font_ttf https://unpkg.com/element-ui@2.4.8/lib/theme-chalk/fonts/element-icons.ttf
// @resource ele_font_woff https://unpkg.com/element-ui@2.4.8/lib/theme-chalk/fonts/element-icons.woff
// @require https://cdn.jsdelivr.net/npm/vue/dist/vue.js
// @require https://unpkg.com/axios@0.18.0/dist/axios.min.js
// @require https://cdn.jsdelivr.net/npm/js-cookie@2/src/js.cookie.min.js
// @require https://unpkg.com/element-ui/lib/index.js
// ==/UserScript==
!function(){
    console.log('web helper')
    console.log(Vue, window)
    var yhLibs = {}
    unsafeWindow.yh_libs = window.yh_libs = yhLibs
    ;['axios', 'Vue', 'Cookies', 'ELEMENT'].forEach(function(libName) {
      unsafeWindow.yh_libs[libName] = unsafeWindow[libName] || window[libName]
    })
    var storage = {
        delete: GM_deleteValue,
        list: GM_listValues,
        addListenser: GM_addValueChangeListener,
        removeListener: GM_removeValueChangeListener,
        set: GM_setValue,
        get: GM_getValue,
    }
    var grant = {
        registerMenuCommand: GM_registerMenuCommand,
        unregisterMenuCommand: GM_unregisterMenuCommand,
        storage: storage
    }
    yhLibs.grant = grant
    function injectJs(url) {
      console.log(url)
      var sc = document.createElement('script')
      sc.src = url
      document.head.appendChild(sc)
    }
    injectJs('http://127.0.0.1:8080/app.js?t='+Date.now())
    function dynamicLoadCss(url) {
        var head = document.getElementsByTagName('head')[0];
        var link = document.createElement('link');
        link.type='text/css';
        link.rel = 'stylesheet';
        link.href = url;
        head.appendChild(link);
    }
    // dynamicLoadCss('https://unpkg.com/element-ui/lib/theme-chalk/index.css')
    GM_addStyle(GM_getResourceText('ele_css').
                replace('fonts/element-icons.woff', GM_getResourceURL('ele_font_woff')).
                replace('fonts/element-icons.ttf', GM_getResourceURL('ele_font_ttf')))

}()

